import React from 'react';
import StopWatch from './stopwatch/StopWatch';

const ChestExercise = () => {
    return (
        <div className='workout-program-grid'>
            <h1>Chest Exercise List: </h1>
            <ul>
                <li>Jumping Jacks </li>
                <li>Arm Circles </li>
                <li>Shoulder Stretch </li>
                <li>Push-ups </li>
                <li>Decline Push-ups </li>
                <li>Diamond Push-ups </li>
                <li>Spiderman Push-ups </li>
                <li>Burpees </li>
            </ul>
            <p style={{"font-weight":"400", "font-size": "1.3rem"}}>*Minimum of 12 reps with 2 sets for each movement</p>
            <StopWatch />
            <iframe style={{"borderRadius": "12px", "marginTop": "2.2rem"}} src="https://open.spotify.com/embed/playlist/0sWyckJ8KrH2HbdiRGliyl?utm_source=generator" width="1044px" height="90px" frameBorder="0" allowfullscreen="" allow="autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture" title='chest-album'></iframe>
        </div>
    )
}

export default ChestExercise;
